import 'package:equatable/equatable.dart';class FeedbackMd extends Equatable {  int? id;  String? feedback;  String? userId;  int? rating;  String? imageUrl;  FeedbackMd({    this.id,    this.feedback,    this.userId,    this.rating,    this.imageUrl,  });  @override  List<Object?> get props => [        id,        feedback,        userId,        rating,        imageUrl,      ];  factory FeedbackMd.fromJson(Map<String, dynamic> json) {    try {      return FeedbackMd(        id: json['id'],        feedback: json['feedback'],        userId: json['user_id'],        rating: json['rating'],        imageUrl: json['image_url'],      );    } catch (e) {      print('Error: $e');      return FeedbackMd();    }  }  Map<String, dynamic> toJson() {    return {      'id': id,      'feedback': feedback,      'user_id': userId,      'rating': rating,      'image_url': imageUrl,    };  }}